  false,\n\t\"url\": null,\n\t\"notes\": \"Data and information collected by the submersible
  Johnson Sea-Link II along its track during seventeen dives of the 2003 \"Life on
  the Edge: Exploring Deep Ocean Habitats\" expedition sponsored by the National Oceanic
  and Atmospheric Administration (NOAA) Office of Ocean Exploration, August 16 through
  August 27, 2003. Measurements and information include sub's position, altitude,
  and depth; personnel assignments; dive, mission, and vehicle ID's; and sound velocity
  measurements. The Marine Operations Division of the Harbor Branch Oceanographic
  Institution provided the original submersible data.\",\n\t\"license_title\": null,\n\t\"extras\":
